import{_ as e,o as a,c as d,a as o}from"./app.2d263659.js";const m=JSON.parse('{"title":"\u8FD0\u884C\u6A21\u5F0F","description":"","frontmatter":{"sidebarDepth":2,"collapsable":false},"headers":[{"level":2,"title":"\u4FDD\u6D3B\u6A21\u5F0F","slug":"\u4FDD\u6D3B\u6A21\u5F0F"},{"level":2,"title":"\u5355\u4F8B\u6A21\u5F0F","slug":"\u5355\u4F8B\u6A21\u5F0F"},{"level":2,"title":"\u91CD\u5EFA\u6A21\u5F0F","slug":"\u91CD\u5EFA\u6A21\u5F0F"}],"relativePath":"guide/mode.md","lastUpdated":1662723390000}'),c={name:"guide/mode.md"},t=o('<h1 id="\u8FD0\u884C\u6A21\u5F0F" tabindex="-1">\u8FD0\u884C\u6A21\u5F0F <a class="header-anchor" href="#\u8FD0\u884C\u6A21\u5F0F" aria-hidden="true">#</a></h1><p><img src="https://vfiles.gtimg.cn/wuji_dashboard/xy/test_wuji_damy/F0NYfpHl.jpeg" alt="\u65E0\u754C\u6D41\u7A0B\u56FE.jpeg"></p><p>\u5728\u5FAE\u524D\u7AEF\u6846\u67B6\u4E2D\uFF0C\u5B50\u5E94\u7528\u653E\u7F6E\u5728\u4E3B\u5E94\u7528\u9875\u9762\u4E2D\u968F\u7740\u4E3B\u5E94\u7528\u9875\u9762\u7684\u6253\u5F00\u548C\u5173\u95ED\u53CD\u590D\u7684\u6FC0\u6D3B\u548C\u9500\u6BC1\uFF0C\u800C\u5728\u65E0\u754C\u5FAE\u524D\u7AEF\u6846\u67B6\u4E2D\u5B50\u5E94\u7528\u662F\u5426\u4FDD\u6D3B\u4EE5\u53CA\u662F\u5426\u8FDB\u884C\u751F\u547D\u5468\u671F\u7684\u6539\u9020\u4F1A\u8FDB\u5165\u5B8C\u5168\u4E0D\u540C\u7684\u5904\u7406\u6D41\u7A0B</p><h2 id="\u4FDD\u6D3B\u6A21\u5F0F" tabindex="-1">\u4FDD\u6D3B\u6A21\u5F0F <a class="header-anchor" href="#\u4FDD\u6D3B\u6A21\u5F0F" aria-hidden="true">#</a></h2><p>\u5B50\u5E94\u7528\u7684 <a href="/doc/api/startApp.html#alive">alive</a> \u8BBE\u7F6E\u4E3A<code>true</code>\u65F6\u8FDB\u5165\u4FDD\u6D3B\u6A21\u5F0F\uFF0C\u5185\u90E8\u7684\u6570\u636E\u548C\u8DEF\u7531\u7684\u72B6\u6001\u4E0D\u4F1A\u968F\u7740\u9875\u9762\u5207\u6362\u800C\u4E22\u5931\u3002</p><p>\u5728\u4FDD\u6D3B\u6A21\u5F0F\u4E0B\uFF0C\u5B50\u5E94\u7528\u53EA\u4F1A\u8FDB\u884C\u4E00\u6B21\u6E32\u67D3\uFF0C\u9875\u9762\u53D1\u751F\u5207\u6362\u65F6\u627F\u8F7D\u5B50\u5E94\u7528<code>dom</code>\u7684<code>webcomponent</code>\u4F1A\u4FDD\u7559\u5728\u5185\u5B58\u4E2D\uFF0C\u5F53\u5B50\u5E94\u7528\u91CD\u65B0\u6FC0\u6D3B\u65F6\u65E0\u754C\u4F1A\u5C06\u5185\u5B58\u4E2D\u7684<code>webcomponent</code>\u4ECE\u65B0\u6302\u8F7D\u5230\u5BB9\u5668\u4E0A</p><p>\u4FDD\u6D3B\u6A21\u5F0F\u4E0B\u6539\u53D8 <a href="/doc/api/startApp.html#url">url</a> \u5B50\u5E94\u7528\u7684\u8DEF\u7531\u4E0D\u4F1A\u53D1\u751F\u53D8\u5316\uFF0C\u9700\u8981\u91C7\u7528 <a href="/doc/guide/communication.html">\u901A\u4FE1</a> \u7684\u65B9\u5F0F\u5BF9\u5B50\u5E94\u7528\u8DEF\u7531\u8FDB\u884C\u8DF3\u8F6C</p><div class="warning custom-block"><p class="custom-block-title">\u6CE8\u610F</p><p>\u4FDD\u6D3B\u7684\u5B50\u5E94\u7528\u7684\u5B9E\u4F8B\u4E0D\u4F1A\u9500\u6BC1\uFF0C\u5B50\u5E94\u7528\u88AB\u5207\u8D70\u4E86\u4E5F\u53EF\u4EE5\u54CD\u5E94 bus \u4E8B\u4EF6\uFF0C\u975E\u4FDD\u6D3B\u7684\u5B50\u5E94\u7528\u5207\u8D70\u4E86\u76D1\u542C\u7684\u4E8B\u4EF6\u4E5F\u4F1A\u5168\u90E8\u9500\u6BC1\uFF0C\u9700\u8981\u7B49\u4E0B\u6B21\u91CD\u65B0 mount \u540E\u91CD\u65B0\u76D1\u542C\u3002</p></div><h2 id="\u5355\u4F8B\u6A21\u5F0F" tabindex="-1">\u5355\u4F8B\u6A21\u5F0F <a class="header-anchor" href="#\u5355\u4F8B\u6A21\u5F0F" aria-hidden="true">#</a></h2><p>\u5B50\u5E94\u7528\u7684<code>alive</code>\u4E3A<code>false</code>\u4E14\u8FDB\u884C\u4E86<a href="/doc/guide/start.html#\u751F\u547D\u5468\u671F\u6539\u9020">\u751F\u547D\u5468\u671F\u6539\u9020</a>\u65F6\u8FDB\u5165\u5355\u4F8B\u6A21\u5F0F\u3002</p><p>\u5B50\u5E94\u7528\u9875\u9762\u5982\u679C\u5207\u8D70\uFF0C\u4F1A\u8C03\u7528<code>window.__WUJIE_UNMOUNT</code>\u9500\u6BC1\u5B50\u5E94\u7528\u5F53\u524D\u5B9E\u4F8B\uFF0C\u5B50\u5E94\u7528\u9875\u9762\u5982\u679C\u5207\u6362\u56DE\u6765,\u4F1A\u8C03\u7528<code>window.__WUJIE_MOUNT</code>\u6E32\u67D3\u5B50\u5E94\u7528\u65B0\u7684\u5B50\u5E94\u7528\u5B9E\u4F8B</p><p>\u5728\u5355\u4F8B\u5F0F\u4E0B\uFF0C\u6539\u53D8 <a href="/doc/api/startApp.html#url">url</a> \u5B50\u5E94\u7528\u7684\u8DEF\u7531\u4F1A\u53D1\u751F\u8DF3\u8F6C\u5230\u5BF9\u5E94\u8DEF\u7531</p><p>\u5982\u679C\u4E3B\u5E94\u7528\u4E0A\u6709\u591A\u4E2A\u83DC\u5355\u680F\u7528\u5230\u4E86\u5B50\u5E94\u7528\u7684\u4E0D\u540C\u9875\u9762\uFF0C\u5728\u6BCF\u4E2A\u9875\u9762\u542F\u52A8\u8BE5\u5B50\u5E94\u7528\u7684\u65F6\u5019\u5C06<code>name</code>\u8BBE\u7F6E\u4E3A\u540C\u4E00\u4E2A\uFF0C\u8FD9\u6837\u53EF\u4EE5\u5171\u4EAB\u4E00\u4E2A<code>wujie</code>\u5B9E\u4F8B\uFF0C\u627F\u8F7D\u5B50\u5E94\u7528<code>js</code>\u7684<code>iframe</code>\u4E5F\u5B9E\u73B0\u4E86\u5171\u4EAB\uFF0C\u4E0D\u540C\u9875\u9762\u5B50\u5E94\u7528\u7684<code>url</code>\u4E0D\u540C\uFF0C\u5207\u6362\u8FD9\u4E2A\u5B50\u5E94\u7528\u7684\u8FC7\u7A0B\u76F8\u5F53\u4E8E\uFF1A\u9500\u6BC1\u5F53\u524D\u5E94\u7528\u5B9E\u4F8B =&gt; \u540C\u6B65\u65B0\u8DEF\u7531 =&gt; \u521B\u5EFA\u65B0\u5E94\u7528\u5B9E\u4F8B</p><h2 id="\u91CD\u5EFA\u6A21\u5F0F" tabindex="-1">\u91CD\u5EFA\u6A21\u5F0F <a class="header-anchor" href="#\u91CD\u5EFA\u6A21\u5F0F" aria-hidden="true">#</a></h2><p>\u5B50\u5E94\u65E2\u6CA1\u6709\u8BBE\u7F6E\u4E3A\u4FDD\u6D3B\u6A21\u5F0F\uFF0C\u4E5F\u6CA1\u6709\u8FDB\u884C\u751F\u547D\u5468\u671F\u7684\u6539\u9020\u5219\u8FDB\u5165\u4E86\u91CD\u5EFA\u6A21\u5F0F\uFF0C\u6BCF\u6B21\u9875\u9762\u5207\u6362\u4E0D\u4EC5\u4F1A\u9500\u6BC1\u627F\u8F7D\u5B50\u5E94\u7528<code>dom</code>\u7684<code>webcomponent</code>\uFF0C\u8FD8\u4F1A\u9500\u6BC1\u627F\u8F7D\u5B50\u5E94\u7528<code>js</code>\u7684<code>iframe</code>\uFF0C\u76F8\u5E94\u7684<code>wujie</code>\u5B9E\u4F8B\u548C\u5B50\u5E94\u7528\u5B9E\u4F8B\u90FD\u4F1A\u88AB\u9500\u6BC1</p><p>\u91CD\u5EFA\u6A21\u5F0F\u4E0B\u6539\u53D8 <a href="/doc/api/startApp.html#url">url</a> \u5B50\u5E94\u7528\u7684\u8DEF\u7531\u4F1A\u8DF3\u8F6C\u5BF9\u5E94\u8DEF\u7531\uFF0C\u4F46\u662F\u5728 <a href="/doc/guide/sync.html">\u8DEF\u7531\u540C\u6B65</a> \u573A\u666F\u5E76\u4E14\u5B50\u5E94\u7528\u7684\u8DEF\u7531\u540C\u6B65\u53C2\u6570\u5DF2\u7ECF\u540C\u6B65\u5230\u4E3B\u5E94\u7528<code>url</code>\u4E0A\u65F6\u5219\u65E0\u6CD5\u751F\u6548\uFF0C\u56E0\u4E3A\u6539\u53D8<code>url</code>\u540E\u4F1A\u5BFC\u81F4\u5B50\u5E94\u7528\u9500\u6BC1\u91CD\u65B0\u6E32\u67D3\uFF0C\u6B64\u65F6\u5982\u679C\u6709\u540C\u6B65\u53C2\u6570\u5219\u540C\u6B65\u53C2\u6570\u7684\u4F18\u5148\u7EA7\u6700\u9AD8</p>',16),r=[t];function i(p,l,s,h,n,u){return a(),d("div",null,r)}const f=e(c,[["render",i]]);export{m as __pageData,f as default};
